import React, {useState, useEffect, useReducer} from 'react';
import {Link} from "react-router-dom";
import {useParams} from "react-router-dom";

const initialState = {
    loading: true,
    error: '',
    models: {}

};

const reducer = (state, action) => {
    switch (action.type){
        case  'FETCH_SUCCESS':
            return{
                loading: false,
                error: '',
                models: action.payload
            }
        case  'FETCH_ERROR':
            return{
                loading: false,
                error: 'Something went wrong(',
                models: {}
            }
        default:
            return state
    }
}

function Komissar() {

    const params = useParams();

    const [state, dispatch] = useReducer(reducer, initialState);


    useEffect(() => {

        fetch(`http://127.0.0.1:8000/komissar/`)
            .then(response => response.json())

            .then(data => {
                dispatch({type: 'FETCH_SUCCESS', payload: data})
            })
            .catch(error => {
                dispatch({type: 'FETCH_ERROR'})
            })
    }, []);


    return (
        <div>
            <Link to="/komissar">Комиссары</Link>
            <div className={"assortment"}><h1>Военные комиссары</h1><br/></div>
            <div className={"priziv_list"}>
            {state.loading ? 'Loading' :
                <ul>
                <div>Название: {state.models.name}</div>
                <div>Описание: {state.models.surname}</div>
                <div>Цена: {state.models.rang} ₽</div>
                </ul>}
            {state.error ? state.error : null}
            </div>
        </div>
    );
}

export default Komissar;
